    "Like many of you all, I'm working both in a local session and in this one. My intention is for this to be the ✨ clean one.  Your feedback and comments are welcome.\n",
    "\n",
    "The approach shown here does the following:\n",
    "\n",
    "- Loads handy metapackages tidyverse and tidymodels for data manipulation and machine learning \n",
    "- Loads bonsai, an interface with lightgbm\n",
    "- Loads stacks, an ensembling tool\n",
    "- Builds the kap quadratic performance metric\n",
    "- Reads train and test csv data files and runs them through column name cleaning and the creation of a handful of new features using algebra\n",
    "- Handles multi-class imbalance with a couple stages of upsampling and extra cross-validation\n",
    "- Models the training data, transformed, with both xgboost and lightgbm\n",
    "\n",
    "Let's dive in."
   ]
  },
