    "## Load datasets\n",
    "\n",
    "Credit to [Jose Caliz](https://www.kaggle.com/jcaliz) for these simple [feature engineering](https://www.kaggle.com/competitions/playground-series-s3e5/discussion/382698) ideas.\n",
    "\n",
    "Generally, I'd rather put the engineered features into recipes to run on each cross validation fold alone and avoid any chance of data leakage. On the other hand, these five simple algebraic transformations are safe. Putting them here at the data import makes them available for study as interactions and polynomial transformations further down."
