    "preprocessor <- function(data){\n",
    "  data %>%\n",
    "    janitor::clean_names() %>%\n",
    "          mutate(total_acidity = fixed_acidity + volatile_acidity + citric_acid,\n",
    "           acid_per_density = total_acidity / density,\n",
    "           density_per_alcohol = density / alcohol,\n",
    "           sulphates_per_density = sulphates / density,\n",
    "           sulphates_per_volatile_acidity = sulphates / volatile_acidity,\n",
    "           sulphates_per_chlorides = sulphates / chlorides)\n",
    "}\n",
    "\n",
    "raw_df <- read_csv(\"../input/playground-series-s3e5/train.csv\",\n",
    "                   show_col_types = FALSE) %>% \n",
    "          preprocessor() %>% \n",
    "          distinct(across(-id), .keep_all = TRUE) %>% \n",
    "          mutate(quality = factor(quality, ordered = TRUE)) \n",
    "\n",
    "competition_df <- read_csv(\"../input/playground-series-s3e5/test.csv\",\n",
    "                   show_col_types = FALSE) %>%  \n",
    "          preprocessor()\n",
    "\n",
    "dim(raw_df)\n",
    "dim(competition_df)\n",
    "\n",
    "raw_df %>%\n",
    "  count(quality)"
   ]
