    "set.seed(42)\n",
    "\n",
    "train_df <- recipe(quality ~ ., data = raw_df) %>% \n",
    "  themis::step_adasyn(quality, over_ratio = 0.11)  %>%\n",
    "  prep()  %>% \n",
    "  bake(new_data = NULL)\n",
    "\n",
    "train_df %>%\n",
    "   count(quality) \n",
    "\n",
    "folds <- vfold_cv(train_df, \n",
    "                  v = 10,\n",
    "                  repeats = 10,\n",
    "                  strata = quality)"
   ]
