    "  update_role(id, new_role = \"id\") %>%\n",
    "  themis::step_upsample(quality) %>% \n",
    "  step_interact(~ residual_sugar:density_per_alcohol) %>%\n",
    "  step_interact(~ sulphates:alcohol) %>%\n",
    "  step_interact(~ density_per_alcohol:sulphates_per_volatile_acidity) %>%\n",
    "  step_interact(~ fixed_acidity:free_sulfur_dioxide)   %>%\n",
    "  step_interact(~ density_per_alcohol:sulphates_per_chlorides) %>%\n",
    "  step_YeoJohnson(all_numeric_predictors()) %>%\n",
    "  step_corr(all_numeric_predictors())\n",
    "\n",
    "rec %>% prep() %>% bake(new_data = NULL) %>% \n",
    "    pivot_longer(\n",
    "    -c(id,quality),\n",
    "    names_to = \"metric\",\n",
    "    values_to = \"value\"\n",
    "  ) %>% \n",
    "  ggplot(aes(value, fill = quality, color = NULL)) +\n",
    "  geom_density(alpha = 0.6) +\n",
    "  scale_fill_brewer(palette = \"RdYlBu\") +\n",
    "  facet_wrap(vars(metric), scales = \"free\") +\n",
    "  labs(title = \"Recipe output after transformations\") +\n",
    "  theme_dark() +\n",
    "  theme(panel.grid.major = element_blank(),\n",
    "        panel.grid.minor = element_blank())\n",
    "\n",
    "rec %>% prep() %>% bake(new_data = NULL) %>% \n",
    "  correlate(quiet = TRUE) %>%\n",
    "  rearrange() %>% \n",
    "  shave() %>% \n",
    "  rplot() +\n",
    "  scale_x_discrete(guide = guide_axis(n.dodge = 6)) +\n",
    "  labs(title = \"Pairwise Correlations of Transformed Training Set\")\n"
   ]
  },
