    "## Control parameters\n",
    "\n",
    "For the `stacks` ensembling to work, we will need to have tidymodels retain all the predictions and workflows from the individual cross validations folds and repeats. For a relatively small dataseet like this one, the overhead is not a big deal. \n",
    "\n",
    "More importantly, the extra cross validation should help us get a more robust estimate of performance on new data, and avoid overfitting."
   ]
  },
